import React from 'react'
import MultiLevelSelect from 'react-multi-level-selector'

const options = [
    {
        value: 'mesoregiao',
        label: 'Mesoregiao',
        options: [
            {
                value: 'citrus',
                label: 'Citrus',
                options: [
                    { value: 'orange', label: 'Orange' },
                    { value: 'grapefruits', label: 'GrapeFruits' },
                ],
            },
            {
                value: 'tropical',
                label: 'Tropical',
                options: [
                    { value: 'mango', label: 'Mango' },
                    { value: 'papaya', label: 'Papaya' },
                ],
            },
            {
                value: 'berries',
                label: 'Berries',
                options: [
                    { value: 'strawberry', label: 'Strawberry' },
                    { value: 'raspberries', label: 'Raspberries' },
                ],
            },
        ],
    },
    {
        value: 'microregiao',
        label: 'Microregiao',
        options: [
            { value: 'dublin', label: 'Belo Horizonte' },
            { value: 'new york', label: 'Montes Claros' },
            { value: 'san fransis', label: 'Contagem' },
        ],
    },
]
function Cidades() {
    return (
        <div>
            <MultiLevelSelect options={options} />
        </div>
    )
}

export default Cidades
